      <div  className="background">



              
<div className="navigationreponse"> <button onClick={() => {
                history.push(`/form3`);
              } }> Vers autres models </button>
              
              
              
              </div>



    



<div  className="ajustementenligne">


<div className="question">


<div className="test1">


<span value="" > {recupere} </span>  </div>


<div className="test2">


<div className="anim">
   
      <img
