<img
          src={img}
          alt=""
        />





  
        <img
          src={img2}
          alt=""
        />


        <img
          src={img3}
          alt=""
        />




        <img
          src={img4}
          alt=""
        />





        <img
          src={img5}
          alt=""
        />   
      </div>
        
      </div>
      
      </div>
    
      </div>




      <div className="navigationreponse"><button onClick={() => {
                history.push(`/tarots2reverse`);
              } }> Tirage même question </button>  
              
              
              
              </div> </div>
    );
  }
  
  export default Tarots2reverse;
